function initialize(){var e=new google.feeds.Feed("https://github.com/goofiw.atom");e.load(function(e){if(!e.error){console.log(e);for(var n=document.getElementById("github-content"),o=0;o<e.feed.entries.length;o++){var t=e.feed.entries[o],i=document.createElement("div");i.innerHTML="<a href="+t.link+">"+t.contentSnippet+"</a>",n.appendChild(i)}}})}google.load("feeds","1"),google.setOnLoadCallback(initialize);